// WorkoutPlan.tsx
import React from 'react';
import { useParams } from 'react-router-dom';
import { Container, Typography, Box } from '@mui/material';

interface Exercise {
  name: string;
  reps: number;
  sets: number;
}

interface WorkoutPlanData {
  id: number;
  title: string;
  exercises: Exercise[];
}

const WorkoutPlan: React.FC = () => {
  const { id } = useParams<{ id?: string }>();
  const workoutPlan: WorkoutPlanData = {
    id: id ?? 1, // Provide a default value for id if it's undefined
    title: `Workout Plan ${id ?? 'default'}`,
    exercises: [
      { name: 'Exercise A', reps: 10, sets: 3 },
      { name: 'Exercise B', reps: 12, sets: 4 },
      // Add more exercises as needed
    ],
  };

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        {workoutPlan.title}
      </Typography>
      <Box>
        {workoutPlan.exercises.map((exercise, index) => (
          <div key={index}>
            <Typography variant="body1" color="textPrimary">
              {exercise.name}
            </Typography>
            <Typography variant="body2" color="textSecondary">
              {`${exercise.reps} reps / ${exercise.sets} sets`}
            </Typography>
          </div>
        ))}
      </Box>
    </Container>
  );
};

export default WorkoutPlan;
